<!DOCTYPE html>
<html lang="ru">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport"
              content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">
        <title>Document</title>
        <link rel="stylesheet" href="./css/style.css">
    </head>
    <body>
        <h1>Fias-id Fisher</h1>
        <div class="attention">Open console for watching program's work!</div>
        <nav>
            <button class="btn" type="button" id="start">Start parsing</button>
            <button class="btn" type="button" id="result">Show result of parsing</button>
            <button class="btn" type="button" id="storage">Get localStorage</button>
            <button class="btn" type="button" id="clear">Clear</button>
            <button class="btn" type="button" id="copy">Copy result</button>
        </nav>
        <div class="output">
            <div class="output_inner">
                <code id="output">
                    <span class="msg blick">Press "Start parsing" for begin</span>
                </code>
            </div>
        </div>
        <script>
            document.addEventListener('DOMContentLoaded', () => {
                let preparedData = {
                        catchedAddressesArr: Object.values(<?= $addressesJSON ?>),
                        getQueryes: function() {
                            let addresses = [];
                            for(let i = 0; i <= this.catchedAddressesArr.length; i++) {
                                addresses[i] = this.catchedAddressesArr[i];
                                if(i >= 2500) break;
                            }
                            return addresses;
                        }
                    },
                    queryes = preparedData.getQueryes().slice(1),
                    btnStartParsing = document.getElementById('start'),
                    btnShowResultOfParsing = document.getElementById('result'),
                    btnGetLocalStorage = document.getElementById('storage'),
                    btnClear = document.getElementById('clear'),
                    btnCopyResult = document.getElementById('copy'),
                    output = document.getElementById('output'),
                    fias_id_arr = [],
                    accepted = [],
                    rejected = [],
                    queryNum = 0,
                    is_started = false,
                    default_message = '<span class="msg blick">Press "Start parsing" for begin</span>',
                    empty_result = '<span class="msg msg_service">Press "Start parsing" to get result</span>';

                btnStartParsing.addEventListener('click', () => {
                    is_started = true;
                    output.innerHTML = '';
                    function fecthData() {
                        setTimeout( function launch() {
                            let entryPoints = {
                                    url: "https://suggestions.dadata.ru/suggestions/api/4_1/rs/suggest/address",
                                    token: "d04f85b97ddfe613eb894481695fa9a401447df0",
                                    query: queryes[queryNum++]
                                },
                                options = {
                                    method: "POST",
                                    mode: "cors",
                                    headers: {
                                        "Content-Type": "application/json",
                                        "Accept": "application/json",
                                        "Authorization": `Token ${entryPoints.token}`
                                    },
                                    body: JSON.stringify({query: entryPoints.query})
                                }

                            async function getResponses() {
                                await fetch(entryPoints.url, options)
                                        .then(response => response.text())
                                        .then(result => (function () {
                                            let suggestions = JSON.parse(result).suggestions,
                                                fiasId = suggestions[0].data.fias_id,
                                                address = suggestions[0].value,
                                                message = `<span class="msg msg_access">${queryNum}--${address}--${fiasId}</span>\n`;
                                            fias_id_arr[queryNum] = fiasId;
                                            accepted.push(queryNum);
                                            output.innerHTML += message;
                                            output.scrollTop = output.scrollHeight;
                                        }()))
                                        .catch((error) => {
                                            let message = `<span class="msg msg_error">${queryNum}--${error}</span>\n`;
                                            output.innerHTML += message;
                                            output.scrollTop = output.scrollHeight;
                                            rejected.push(queryNum);
                                        })
                            }
                            getResponses();
                            if(queryNum < queryes.length) setTimeout(launch, 1100);
                        })
                    }
                    fecthData();

                    setTimeout(function saveInStorage() {
                        localStorage.setItem("data", JSON.stringify(fias_id_arr));
                        localStorage.setItem("saved", accepted.length);
                        localStorage.setItem("lost", rejected.length);
                        setTimeout(saveInStorage, 1100);
                    }, 1100);
                });

                btnShowResultOfParsing.addEventListener('click', () => {
                    if (!is_started) output.innerHTML = '';
                    let message;
                    fias_id_arr.length ?
                        message = `
                            <span class="msg msg_service">${JSON.stringify(fias_id_arr)}</span>\n
                            <span class="msg msg_service">Numbers of accepted queries: ${accepted}</span>\n
                            <span class="msg msg_service">Numbers of rejected queries: ${rejected}</span>\n
                        ` :
                        message = empty_result;
                    output.innerHTML += message;
                });

                btnGetLocalStorage.addEventListener('click', () => {
                    if (!is_started) output.innerHTML = '';
                    if (localStorage.getItem('data') && localStorage.getItem('saved') && localStorage.getItem('lost')) {
                        let message = `
                            <span class="msg msg_service">Queries accepted: ${localStorage.getItem('saved')}</span>\n
                            <span class="msg msg_service">Queries rejected: ${localStorage.getItem('lost')}</span>\n
                            <span class="msg msg_service">${localStorage.getItem('data')}</span>\n
                        `;
                        output.innerHTML += message;
                    } else {
                        let message = "В localStorage пусто";
                        output.innerHTML += message;
                    }
                });

                btnClear.addEventListener('click', () => {
                    output.innerHTML = default_message;
                });

                btnCopyResult.addEventListener('click', () => {
                    if (!is_started) output.innerHTML = '';
                    let result = localStorage.getItem('data'),
                        copyResult = () => {
                            let dummy = document.createElement('textarea');
                            document.body.appendChild(dummy);
                            dummy.setAttribute('id', 'dummy_id');
                            document.getElementById('dummy_id').value = result;
                            dummy.select();
                            document.execCommand('copy');
                            document.body.removeChild(dummy);
                        };
                    if (result.length) {
                        copyResult();
                        let message = `
                            <span class="msg msg_service">Copyed:</span>\n
                            <span class="msg msg_service">${result}</span>\n
                        `;
                        output.innerHTML += message;
                    } else {
                        output.innerHTML = empty_result;
                    }
                });
            })
        </script>
    </body>
</html>
